package com.randomusers.albertsonsrandomuserslist.presenter.screens.mainimport com.randomusers.albertsonsrandomuserslist.data.model.UsersModelimport com.randomusers.albertsonsrandomuserslist.presenter.screens.detail.DetailScreenimport com.randomusers.albertsonsrandomuserslist.utils.navigation.AppNavigatorimport javax.inject.Injectinterface MainDirection {    suspend fun moveToDetail(model: UsersModel)}class MainDirectionImpl @Inject constructor(    private val appNavigator: AppNavigator,) : MainDirection {    override suspend fun moveToDetail(model: UsersModel) {        appNavigator.openWithSave(DetailScreen(model))    }}